import React, {useEffect} from "react";
import Main from "./Main";
import {connect} from "react-redux";
import {compose} from "redux";
import {withRouter} from "react-router-dom";
import {getAppleThunk, getXiaomiThunk, initializeApp, initializeFeedbackAC} from "../../Redux/Reduser";


const MainContainer = ({getAppleThunk,getXiaomiThunk,xiaomi,apple,Search,initializeApp,initializeFeedback,initializeFeedbackAC}) => {


   

    useEffect(()=>{
        initializeFeedbackAC(false)
        initializeApp()
    })



    return<Main initializeFeedback={initializeFeedback} xiaomi={xiaomi} apple={apple}  Search={Search}/>
}



const mapStateToProps = (state) => {
    return {
        apple: state.Reduser.apple,
        xiaomi: state.Reduser.xiaomi,
        Search:state.Reduser.search,
        initializeFeedback: state.Reduser.initializeFeedback
    }
}

export default compose(
    connect(mapStateToProps,{getXiaomiThunk,getAppleThunk,initializeApp,initializeFeedbackAC}),
    withRouter
)(MainContainer)
